import React from "react";
import "../css/uploadExamsheet.css";
import { Card } from "antd";
const UploadExamsheet = () => {
  return (
    <div>
      <h1 className="Title">Upload Examsheet</h1>
      <Card
        title="Default size card"
        extra={<a href="#">More</a>}
        style={{
          width: 300,
        }}
      >
        <p>Card content</p>
      </Card>
    </div>
  );
};

export default UploadExamsheet;
